import React, { Component } from 'react';
import './assets/section.css';
import project1 from './assets/images/project1.png';
import project2 from './assets/images/project2.png';
import project3 from './assets/images/project3.png';

class Projects extends Component{
    render(){
        return(
            <section id = "projects" style = {{ background : "#222222" }}>
                    <h2 className = "text-center">My <strong>Projects</strong></h2><br/>
                    <div className = "row pl-auto pr-auto">
                        
                        <div className = "col-md-4">
                            <div className = "card">
                                <a href = "https://github.com/rupeshmohanty/Blog-api-using-nodejs" target = "_blank"><img src = { project1 } alt = "NodeJs project"/></a>
                                <div className = "card-body">
                                    <h4>Blog API using NodeJS,MongoDB and Express</h4>
                                </div>
                            </div>
                        </div>
                        <div className = "col-md-4">
                        <div className = "card">
                                <a href = "https://github.com/rupeshmohanty/Spectrum" target = "_blank"><img src = { project2 } alt = "Spectrum Club" height = "350"/></a>
                                <div className = "card-body">
                                    <h4>Technical Club Website</h4>
                                </div>
                            </div>
                        </div>
                        <div className = "col-md-4">
                        <div className = "card">
                                <a href = "https://github.com/rupeshmohanty/student-attendance-system" target = "_blank"><img src = { project3 } alt = "Student Attendance System" height="350"/></a>
                                <div className = "card-body">
                                    <h4>Student Attendance System</h4>
                                </div>
                            </div>
                        </div>
                        
                        
                    </div>
            </section>
        );
    }
}

export default Projects;
